    public static int[][] getMapLevel(int aLevel)
    {
        #if !UNITY_EDITOR
            switch (aLevel)
                {
                    case 1:
                        return  CMapParser.readMap("Assets/Resources/XmlMap/Level1.xml");
                
                    case 2:
                        return  CMapParser.readMap("Assets/Resources/XmlMap/Level2.xml");
                
                }
